import { SuspenseGet } from 'utils/api';

export const fetchResumeList = ({ userId = 0, jwt = '' }) =>
	SuspenseGet({
		url: `/web/resumeList/46`,
		headers: {
			'x-access-token': jwt,
		},
	});
